import React from 'react'
//css
import './Field.css'
//componenets
import Checkbox from '../Checkbox/Checkbox'


export default function Field(props) {


    return (
        <div className="Field">
            <div>
            {props.stats.map((stat) => {
                return <Checkbox value={stat} key={stat}/>
            })}
            </div>
        </div>
    )
}
